import Navigation from "./components/Navigation";
import endpoint from "./endpoint/SpringBootLog";

import { useState, useEffect } from "react";

import './App.css';

function App() {
    localStorage.setItem("token", "token_116048405164800000797")

    const [teste, setTeste] = useState([]);

    function tratarDados(data){
        let springBoot = [];
        let first = 0;
        let last = data.indexOf("at ");
        while(last !== -1){
            springBoot.push(data.slice(first, last));
            first = last;
            last = data.indexOf("at ", first);
        }
        setTeste(springBoot)
    }

    useEffect(() => {
        endpoint.springbootlog()
        .then(data => {
            console.log(data);
            tratarDados(data[1]);
        })
        .catch(error => console.log(error));
    }, [])

    return ( 
        <div className="App" >
            <Navigation />
            {teste.map((linha, index) => {
                return (
                    <div key={index}>
                        <p>{linha}</p>
                    </div>
                );
            })}
        </div>
    );
}

export default App;
